import styled from 'styled-components';

const FooterStyles = styled.li`
  #footer {
    display: grid;
    grid-gap: 0;
    padding: 0;
    margin: 0;
    grid-template-columns: 10vw auto auto auto 10vw;
    grid-template-rows: 10px 30vh 10px;
    background-color: slategray;
  }

  li {
    list-style-type: none;
    font-size: 24px;
    color: snow;
    text-decoration: none;
    padding: 0;
    margin: 0;
  }

  li:hover {
    text-decoration: underline;
  }

  #top {
    grid-row: 1;
    grid-column: 1 / 5;
    padding: 0;
    margin: 0;
    max-height: 10px;
    justify-self: center;
  }

  #left {
    grid-row: 2;
    grid-column: 2;
    padding: 0;
    margin: 0;
    max-height: 30vh;
    justify-self: center;
  }
  #center {
    grid-row: 2;
    grid-column: 3;
    padding: 0;
    margin: 0;
    max-height: 30vh;
    justify-self: center;
  }

  #right {
    grid-row: 2;
    grid-column: 4;
    padding: 0;
    margin: 0;
    max-height: 30vh;
    justify-self: center;
  }
`;

export default FooterStyles;
